original_question:
$\textbf{Τα Παλιά Λημέρια του Juan}$

Ο Juan οργανώνει τα γραμματόσημα στη συλλογή του ανά χώρα και ανά δεκαετία κατά την οποία εκδόθηκαν. Οι τιμές που πλήρωσε γι' αυτά σε ένα κατάστημα γραμματοσήμων ήταν: Βραζιλία και Γαλλία, $6$ σεντς το καθένα, Περού $4$ σεντς το καθένα, και Ισπανία $5$ σεντς το καθένα. (Η Βραζιλία και το Περού είναι χώρες της Νότιας Αμερικής και η Γαλλία και η Ισπανία είναι στην Ευρώπη.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
label(scale(0.8)*"7", (10.5,3.5));
label(scale(0.8)*"4", (10.5,2.5));
label(scale(0.8)*"4", (10.5,1.5));
label(scale(0.8)*"9", (10.5,0.5));

label(scale(0.8)*"70s", (13.5,4.5));
label(scale(0.8)*"12", (13.5,3.5));
label(scale(0.8)*"12", (13.5,2.5));
label(scale(0.8)*"6", (13.5,1.5));
label(scale(0.8)*"13", (13.5,0.5));

label(scale(0.8)*"80s", (16.5,4.5));
label(scale(0.8)*"8", (16.5,3.5));
label(scale(0.8)*"15", (16.5,2.5));
label(scale(0.8)*"10", (16.5,1.5));
label(scale(0.8)*"9", (16.5,0.5));

label(scale(0.8)*"Χώρα", (3,4.5));
label(scale(0.8)*"Βραζιλία", (3,3.5));
label(scale(0.8)*"Γαλλία", (3,2.5));
label(scale(0.8)*"Περού", (3,1.5));
label(scale(0.8)*"Ισπανία", (3,0.5));

label(scale(0.9)*"Συλλογή Γραμματοσήμων του Juan", (9,0), S);
label(scale(0.9)*"Αριθμός Γραμματοσήμων ανά Δεκαετία", (9,5), N);
[/asy] Ποια ήταν η μέση τιμή, σε σεντς, των γραμματοσήμων του από τη δεκαετία του $70\text{'s}$; Στρογγυλοποιήστε την απάντησή σας στο πλησιέστερο δέκατο του σεντ.

